# All the different data types
# used like
# string, int, float, bool, dict


# strings and characters
def string():
    return str

# integers
def integer():
    return int

# floating points
# f32, f64
def floating():
    return float

# boolean values
# True or False
def boolean():
    return bool

# dictionaries
# {"name" : "pty"}
def dictionary():
    return dict

def lists():
    return list

# If the type is a user-defined class
def classes(class_name):
    return class_name